import {Routes, Route, useNavigate} from 'react-router-dom';
import React from "react";
import Giphy from "./components/Giphy";
import GiphyIronMan from "./components/GiphyIronMan";
import "./App.css"

export default function App() {
  const navigate = useNavigate();

  const navigateIronMan = () => {
    navigate('/ironman');
  };

  const navigateSearch = () => {
    navigate('/searchgiphy');
  };

  const navigateHome = () => {
    navigate('/');
  };

  return (
    <div>
      <div>
        <button onClick={navigateHome}>Home</button>
        <hr />
        <button onClick={navigateSearch}>Search</button>
        <hr />
        <button onClick={navigateIronMan}>Iron Man</button>

        <Routes>
          <Route path="/ironman" element={<IronMan />} />
          <Route path="/searchgiphy" element={<SearchGiphy />} />
        </Routes>
      </div>
    </div>
  );
}

function SearchGiphy() {
    return (
        <div>
            <Giphy />
        </div>
        );
}

function IronMan() {
    return (
        <div>
            <div>
                <h1 className="ironman">IRON MAN GIPHY</h1>   
            </div>
            <GiphyIronMan />
        </div>
        );
}
